import React, { useState } from "react";

function AdminLogin(){
    const [loginStatus, setLoginStatus] = useState(false);
    const [usernameInput, setUsernameInput] = useState(false);
    const [passwordInput, setPasswordInput] = useState(false);

    function handleChange(e){
        switch(e.target.name){
        case "username":
            setUsernameInput(e.target.value)
            break
        case "password":
            setPasswordInput(e.target.value)
            break
        default:
            setLoginStatus(false);
        }
    }

    function handleLogin(e){
        e.preventDefault();

    }
    return (
        <div>
            <h2>login to DELETE these CRUEL JAPES</h2>
            <form onSubmit={handleLogin}>
                <input type="text" name="username" placeholder="username" onChange={handleChange} value={usernameInput ? usernameInput : null}/>
                <input type="text" name="password" placeholder="password" onChange={handleChange} value={passwordInput ? passwordInput : null}/>
            </form>
        </div>
    )
}

export default AdminLogin
